	        on_talk:  "speech_dialog(		
						self, [~Hey.  Would you rather have hooks\\nfor hands, or buckets for feet?~,
						~Hooks for hands.~, [speech_dialog(
							level.player, [~Hooks for hands.~],
							self, [~Really? I think it would be easier to walk\\non buckets than pick things up with hooks.~],
							level.player, [~Probably, but I walk more than I hold things.~],
							self, [~Understandable.  Okay, here's one:~],
							fire_event('question_2')
							)],
						~Buckets for feet.~, [speech_dialog(
							level.player, [~Buckets for feet.~],
							self, [~I agree.  I could still get around that way.~],
							self, [~Okay, here's one:~],
							fire_event('question_2')
							)],
						~What?~, [speech_dialog(
							level.player, [~What?~],
							self, [~Sorry, I just get\\nreally bored standing here all day.~],
							fire_event('mushroom_intro')
						)]
					])",
			on_question_2: "speech_dialog(
							self, [~Would you rather not bathe for a year, or\\nshare a studio apartment with someone who didn't?~,
									~Not bathe.~, [speech_dialog(
										level.player, [~Not bathe for a year.~],
										self, [~I'm not sure you fully understand\\nthe health risks of not bathing.~],
										level.player, [~I don't care.~],
										[~I could get used to my own smell\\nmore than someone else's.~],
										self, [~Fair enough.  All right, another one:~],
										fire_event('question_3')
										)],
								~Share a studio apartment.~, [speech_dialog(
									level.player, [~I'd rather share a studio apartment\\nwith someone who didn't bathe.~],
									self, [~Me too! The place would stink either way,\\nbut at least <em>you'd</em> feel clean.~],
									self, [~All right, another one:~],
									fire_event('question_3')
									)],
								~Neither of those!~, [speech_dialog(
									level.player,[~I don't want to do either of those!~],
									self, [~I know, but what if you had to pick one?~],
									level.player,[~In the unlikely event I am\\never forced to do one of those...~],
									[~I won't get to choose between them!~],
									self, [~Aw, you're no fun.~],
									level.player,[~Neither is this.~],
									self, [~I'm sorry.  I just get\\nso bored standing here all day.~],
									fire_event('mushroom_intro')
									)]
								])",
			on_question_3: "speech_dialog(
							self, [~Would you rather have thumbs instead of teeth,\\nor only be able to see people's insides?~,
									~Thumbs instead of teeth.~, [speech_dialog(
										level.player, [~I'd rather have thumbs instead of teeth.~],
										self, [~Are you sure?\\nYou'd be a pariah.~],
										level.player, [~Yeah, but who cares\\nwhat people think...~],
										[~...when I can <em>PUNCH THEM\\NIN THE FACE WITH MY MOUTH.</em>~],
										self, [~To each his own, I suppose.~],
										[~Hey, thanks for humoring me.\\nIt's quite boring out here.~],
										fire_event('mushroom_intro')
									)],
									~Only see people's insides.~,[speech_dialog(
										level.player, [~I'd rather only be\\nable to see people's insides.~],
										self, [~Good choice.  It wouldn't impair\\nyour functionality once you got used to it.~],
										[~Hey, thanks for humoring me.\\nIt's quite boring out here.~],
										fire_event('mushroom_intro')
									)],
									~NO.~, [speech_dialog(
										level.player, [~Ew. Nope.  We're done.~],
										[~Now you're just getting creepy.~],
										self, [~I'm sorry.~],
										[~When I'm left alone with my thoughts all day,\\nmy mind goes to weird places.~],
										fire_event('mushroom_intro')
									)]
								])",
			on_mushroom_intro: "speech_dialog(
							level.player, [~What <em>are</em> you doing out here, anyway?~],
							self, [~I'm on guard duty.~],
							level.player, [~What are you guarding against?~],
							self, [~We've got a bit of a mushroom problem.~],
							level.player, [~Mushroom... problem?~],
							self, [~Oh. You haven't heard?~],
							level.player, [~How much trouble can a mushroom make?~],
							self, [~Do you want the long story or the short one?~,
								~The short story.~, [speech_dialog(
									level.player,[~Make it quick.\\nI'm kind of in a hurry.~],
									self, [~Basically, the toxic swamp\\nhas made sentient mushrooms.~],
									[~They're walking around killing things.~],
									level.player,[~Wow, that's crazy.\\nWhat are you doing about it?~],
									self, [~Just containing them.  This bridge\\nkeeps them from advancing into town.~],
									level.player, [~Okay.  Can I cross?~],
									self, [~I wouldn't recommend that.~],
									level.player, [~But it's the only way\\nto go east, right?~],
									self, [~Well, yes, but...~],
									level.player, [~Then I don't really have a choice.~],
									self, [~Suit yourself. I'll send you over.~],
									[~Anyway, I'll be here all day if you\\nwant to ask about anything else.~],
									level.player.store_event('talked_to_whatran',1)
									)],
								~The long story.~, [speech_dialog(
									level.player, [~I've got time.~],
									self, [~Well, on the other side\\nof this cliff is a swamp.~],
									[~We never really went there.\\nNo reason to.~],
									level.player,[~Of course you didn't.\\nWho wants to hang out in a swamp?~],
									self, [~Exactly. So at first, we didn't care\\ntoo much when it started changing~].
									[~It was just little things,\\nlike the leaves turning weird colors...~],
									[~Or the air finding new ways\\nto smell horrible.~],
									[~But then the trees started dying.~],
									[~Entirely new species of vegetation\\nsprang up to take their place.~],
									[~The water turned poisonous.~],
									level.player, [~Sorry to interrupt,\\nbut this sounds kind of...~],
									[~Dramatic.~],
									[~Are you just entertaining yourself again?~],
									self, [~No! If this weren't true, why would\\nI be standing guard out here?~],
									level.player,[~Perhaps because you forgot that\\n<em>plants don't invade villages?</em>~],
									self, [~Well...~],
									level.player,[~Oh.~,
										~I...~, [speech_dialog(
											self, [~Finally, the mushrooms started moving.~],
											level.player, [~Like a flytrap?~],
											self, [~No, they've got legs. They <em>walk.</em>~],
											level.player, [~That's not good.~],
											self, [~No. It is not even a little bit good.~],
											[~We've never dealt with anything\\nlike this before.~],
											[~Luckily, we were able to\\nband together in the face of crisis.~],
											level.player, [~When this blows over, would you mind\\nleading a teamwork seminar at Crevice Village?~],
											self, [~We don't have the military presence\\nto kill the mushrooms as quickly as they grow.~],
											[~But we knocked down the bridge\\nthat used to be here.~],
											[~That was enough to keep them\\nout of the village.~],
											level.player, [~But now you've got a pulley system\\nin case someone wants to cross?~],
											self, [~Sure. <em>If</em> someone wanted to cross.~],
											level.player, [~Yeah, about that...~],
											self, [~You can't possibly be serious.~],
											level.player, [~I wish I wasn't.~],
